import React from "react";
import {Link} from "react-router-dom";
import { GoogleLogout } from 'react-google-login';

export default class Nav extends React.Component {
    constructor(props){
        super(props);
        this.state={
            w:""
        }
    }
    componentDidMount(){
        this.setState({
            w:this.props.u
        })
    }
    render() {
        const logout = (response) => {
            console.log(response);
        }

        console.log(this.state.w)
        const v=this.props.u
        console.log(v)
        return (
            <div>
                <div class="container">
                    <nav className="navbar navbar-expand-lg fixed-top border-bottom border-success" style={{backgroundColor:"#290330"}}>
                        <Link to = "userinterface" className="navbar-brand logo_h"><img src="ourtube-white.svg" style={{ width: "125px", height: "40px;" }} />
                        </Link>
                        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent"
                            aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"></span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul className="navbar-nav ml-auto">
                            <li className="nav-item active nav-link text-dark mt-n2"><Link to ="/" className="nav-link"style={{color:"#FBFBFB"}}>
                                <i class="fa fa-search"></i>
                                <GoogleLogout
                             clientId="658977310896-knrl3gka66fldh83dao2rhgbblmd4un9.apps.googleusercontent.com"
                              buttonText="Logout"
                              onLogoutSuccess={logout}>
                          </GoogleLogout>
                                </Link>
                                </li>
                                <li className="nav-item active nav-link text-dark mt-n2"><Link to ="/search" className="nav-link"style={{color:"#FBFBFB"}}><i class="fa fa-search"></i>{v}aaya</Link>
                                </li>
                                <li class="nav-item dropdown">
                                    <a class="nav-link dropdown-toggle"style={{color:"#FBFBFB"}} href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                        Categories
                                    </a>
                                    <div class="dropdown-menu bg-dark" aria-labelledby="navbarDropdown">
                                        <Link to ="/gaming" class="dropdown-item bg-dark"style={{color:"white"}}>Trending Gaming Videos</Link>
                                        <Link to ="/science" class="dropdown-item bg-dark"style={{color:"white"}} >Trending Science & Technology</Link>
                                        {/* <a class="dropdown-item" href="#">Sufi</a> */}
                                    </div>
                                </li>
                                {/* <a class="dropdown-item" href="#">Something else here</a> */}
                                <li class="nav-item dropdown">
                                    <a class="nav-link dropdown-toggle"style={{color:"#FBFBFB"}} href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                        Regional Language
                                            </a>
                                    <div class="dropdown-menu bg-dark" aria-labelledby="navbarDropdown">
                                        <Link to = "/hindi" class="dropdown-item bg-dark"style={{color:"white"}}>Hindi</Link>
                                        <Link to = "/punjabi" class="dropdown-item bg-dark"style={{color:"white"}}>Punjabi</Link>
                                        <Link to = "/kannada" class="dropdown-item bg-dark"style={{color:"white"}}>Kannada</Link>
                                        <Link to = "english" class="dropdown-item bg-dark"style={{color:"white"}}>English</Link>
                                        <Link to = "religious" class="dropdown-item bg-dark"style={{color:"white"}} href="http://localhost:3000/religious">Bhakti</Link>                   
                                    </div>
                                </li>
                                {/* <li className="nav-item "><Link to = "/" className="nav-link color-blue border border-success" href="http://localhost:3000/">Log Out</Link></li> */}
                            </ul>

                        </div>
                    </nav>
                </div>
                <div className="mt-4"></div>
            </div>
                );
            }
}
